function Home()
{
    return (
        <div className="Home">
            <Container fluid>
                <Header />
                <Row>
                    <div className="Home-introduction">
                        <Col md={{ span: 3, offset: 9 }}>
                            We are here to provide <br />
                            guidance and support <br />
                            to mothers and families <br />
                            <Button variant="primary">Our Story</Button>
                        </Col>
                    </div>
                </Row>
                <Row>

                </Row>
            </Container>
        </div>
    );
}

export default Home;
